import React from "react";

export default function Title() {
  const titleStyle = {
    position: "absolute",
    top: "190px",
    left: "0",
    right: "0",
    paddingLeft: "20px",
    paddingRight: "20px",
    textAlign: "center",
  };

  const titleBgStyle = {
    display: "inline-block",
    position: "relative",
    verticalAlign: "middle",
    padding: "10px",
    marginLeft: "7px",
    marginRight: "7px",
  };

  const titleWordStyle = {
    display: "inline-block",
    position: "relative",
    verticalAlign: "middle",
    padding: "10px",
    marginLeft: "7px",
    marginRight: "7px",
    fontSize: "60px",
    textAlign: "center",
    lineHeight: "1.5em",
  };
  const titleAvatarStyle = {
    display: "inline-block",
    position: "relative",
    verticalAlign: "middle",
    padding: "10px",
    marginLeft: "7px",
    marginRight: "7px",
  };
  return (
    <h1 className="title" style={titleStyle}>
      <span className="background" style={titleBgStyle}></span>
      <span className="title" style={titleWordStyle}>
        Alex Geis
      </span>
      <span className="avatar" style={titleAvatarStyle}></span>
    </h1>
  );
}
